export default {
  name: 'StepsResultsSummary',
  props: {
    steps: {
      type: Array,
      required: true
    },
    successCount: {
      type: Number,
      default: 0
    },
    errorCount: {
      type: Number,
      default: 0
    },
    skippedCount: {
      type: Number,
      default: 0
    }
  },
  computed: {
    completionPercentage() {
      if (this.steps.length === 0) return 0;
      const completedCount = this.successCount + this.errorCount + this.skippedCount;
      return completedCount / this.steps.length * 100;
    }
  }
};
